import flash.display.MovieClip;
import com.greensock.TweenMax;

stop ();

var fireStick:MovieClip;
var bound:MovieClip;
var hero:MovieClip;
var vcam:MovieClip;

var sndCtrl:MovieClip = MovieClip(root);
var ground:MovieClip = MovieClip(parent).ground;

init();

function init ():void {
	fireStick = MovieClip(parent).fireStick;
	hero = MovieClip(parent).hero;
	vcam = MovieClip(parent).vcam;
}

function update():void {
	if (this.currentFrame == 1) {
		if (bound.hitTestObject(fireStick.boundFire) && fireStick.onFire) {
			activate();
		}
	}
}

function activate():void {
	this.play();
	hero.switchToHero(false);
	vcam.target = this;
	vcam.zoom = 1.6;
	TweenMax.delayedCall(160, resume, null, true);
}

function resume():void {
	hero.switchToHero();
	hero.active = true;
	vcam.target = hero;
	vcam.zoom = 1;
}
